import { useContext } from "react"
import { dataContext } from "../ReactProject"
import Col from "react-bootstrap/Col"
import Container from "react-bootstrap/Container"
import Row from "react-bootstrap/Row"
import { Link } from "react-router-dom"
function GalleryCom() {
    const context = useContext(dataContext)
    console.log(context);
    return <Container style={{border:'1px solid',marginTop:'30px',backgroundColor:'skyBlue',textAlign:'center'}}>
        <Row>
            <h2>{context.gallery.title}</h2>
            {
                context.gallery.galleryData.map((item) => {
                    console.log(item.id);
                    return <Col key={item.id} sm={4} >
                        <Link to={`/detail/${item.id}`}>
                            <img src={item.imgUrl} style={{ width: '400px' ,height:'400px'}} />
                            <div>
                                <h3>{item.details}</h3>
                            </div>
                        </Link>
                    </Col>

                })
            }
           <Link to={'form'} style={{backgroundColor:'white'}}>click</Link>
        </Row>
       
    </Container>


}
export default GalleryCom
